package db.domain;public class PromptImpl implements Prompt {	@Key	private String uname;	public static final int V_LEN = 16;	private boolean [] v = new boolean[16];	public PromptImpl() {	}	public PromptImpl(Prompt c) {		this.uname = c.getUname();		for (int i = 0; i < v.length; i++) {			v[i] = c.getV(i);		}	}	@Override	public String tableName() {		return "prompt";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setV(int index, boolean value) {		this.v[index] = value;	}	public boolean getV(int index) {		return this.v[index];	}}